import axios from "axios";
import { render } from "nunjucks";
import React, { useEffect } from "react";

export default class SetSelect extends React.Component {
    state = {
        sets : []
    }


    componentDidMount() {
        axios.get("https://api.scryfall.com/sets")
        .then(res => {
            const sets = res.data.data;
            this.setState({ sets })
        })
    }

    render() {
        return (
            <ul>
                {
                    this.state.sets
                    .map(sets =>
                        <li key={sets.id}>{sets.name}</li>)
                    }
            </ul>
        )
    }
}
